import React from "react";
import Key from "./Key";

import classes from "./KeysList.module.css";

const keys = [
  {
    id: "k1",
    content: "Testnet",
  },
  {
    id: "k2",
    content: "Airdrop",
  },
  {
    id: "k3",
    content: "TGE",
  },
  {
    id: "k4",
    content: "Bounty",
  },
  {
    id: "k5",
    content: "Incentive",
  },
  {
    id: "k6",
    content: "Listing",
  },
];

const KeysList = () => {
  return (
    <ul className={classes.keys__list}>
      {keys.map((key) => {
        <Key content={key.content} />;
      })}
    </ul>
  );
};

export default KeysList;
